import React from "react";
import {
  Container,
  Button,
  Form,
  FormGroup,
  FormInput,
  Col,
} from "shards-react";
import { Link } from "react";

export default function PatientLogin() {
  return (
    <Container>
      <Col className="bg-white">
        <h4 className="mb-4 ">Login</h4>
        <Form id="login">
          <FormGroup>
            <label htmlFor="emailAdress">Email</label>
            <FormInput
              id="emailAddress"
              name="emailAddressInput"
              type="email"
              placeholder="Email"
            />
          </FormGroup>
          <FormGroup>
            <label htmlFor="password">Password</label>
            <FormInput
              id="password"
              name="passwordInput"
              type="password"
              placeholder="password"
            />
          </FormGroup>
          {/* <Col> */}
            {/* <Link>Forgot password?</Link> */}
          {/* </Col> */}
          {/* <Col>
            <Button type="submit" Form="login">
              Log In
            </Button>
          </Col> */}
        </Form> 
      </Col>
      {/* <Col>
        Dont have an account? <Link>Sign In</Link>
      </Col> */}
    </Container>
  );
}
